#weekofscreens⁣
Theme: Architecture
[Unbezahlte Werbung/unpaid Advertisement] ⁣

Weekofscreens is back with a new theme, which is all about buildings and other architectual constructions (Alien things count, because Aliens can be architects, too!) My shot is from Detroit, which is such a beautifully built city! And what a game that was ❤️ we're looking forward to see what you found architectually worthy for weekofscreens! ⁣
Rules: ⁣
- Only self-made Screenshots are allowed⁣
- The weekly theme should be the focus of the screenshots' composition⁣
- Use #weekofscreens, so we can find your submissions⁣
- tag us hosts in the screenshot and refer to the event in the description⁣
